  false,\n\t\"url\": null,\n\t\"notes\": \"One, 25-m line transect was surveyed at
  50-cm intervals as part of the Rapid Ecological Assessment conducted at 11 sites
  at French Frigate Shoals in the Northwestern Hawaiian Islands in September, 2004
  from the NOAA vessel Hi'ialakai (HI04-01). Raw survey data included percent live
  coral cover. Following the line-interspect survey, a 6m-wide transect, placed along
  the previously laid 25-m line was examined for the prevalence of coral disease.\",\n\t\"license_title\":
